-- ----------------------------
-- Table structure for act_assignee
-- ----------------------------
DROP TABLE IF EXISTS "public"."act_assignee";
CREATE TABLE "public"."act_assignee" (
  "id" varchar(32) COLLATE "pg_catalog"."default" NOT NULL,
  "sid" varchar(32) COLLATE "pg_catalog"."default" NOT NULL,
  "assignee" varchar(64) COLLATE "pg_catalog"."default",
  "role_id" varchar(32) COLLATE "pg_catalog"."default",
  "assignee_type" int4 NOT NULL,
  "activti_name" varchar(128) COLLATE "pg_catalog"."default"
)
;
COMMENT ON COLUMN "public"."act_assignee"."sid" IS '节点id';
COMMENT ON COLUMN "public"."act_assignee"."assignee" IS '办理人';
COMMENT ON COLUMN "public"."act_assignee"."role_id" IS '候选组(角色)';
COMMENT ON COLUMN "public"."act_assignee"."assignee_type" IS '办理人类型1办理人2候选人3组';
COMMENT ON COLUMN "public"."act_assignee"."activti_name" IS '节点名称';

